import React from 'react';
import styles from '../styles/Home.module.css';

const Home = () => {
    return (
        <section className={styles.homeBody}>
            <div className="home-container">
                <div className="home-content">
                    <h1 className={styles.homeTitle}>
                        Hola, soy <span className="highlight">Marta Cuevas</span>
                    </h1>
                    <h2>Ingeniera de la Salud</h2>
                    <p className={styles.homeDescription}>
                        Apasionada por la innovación en el sector sanitario y la mejora de la calidad de vida a través de la tecnología.
                    </p>
                </div>
                <div className="home-image">
                    <div className="profile-placeholder">
                        <i className="fas fa-user-circle"></i>
                    </div>
                </div>
            </div>
        </section>
    );
};

export default Home;
